import React, { useState } from 'react';
import sitzplan from './sitzplan.svg';
const ReservationPage = () => {
  const [reservation_time, setTime] = useState('');
  const change = (e) => {
    console.log(e.target.value);
  };
  return (
    <div className="App">
      <header className="reservation_header">
        <img src="https://it-designers-gruppe.de/storage/2020/10/logo.jpg" alt="Logo" />
      </header>
      <div className='container h-fill reservation-form'>
        <h2>Reservierung</h2>
        <p>Reservierungszeiten in Minuten</p>
        <div className='mb-3'>
          <input type="radio" className="btn-check" name="reservation_time" id="15min" value={reservation_time} onChange={change}/>
          <label className="btn btn-outline-dark px-4 me-3" for="15min">15</label>
          <input type="radio" className="btn-check" name="reservation_time" id="30min" value={reservation_time} onChange={change}/>
          <label className="btn btn-outline-dark px-4 me-3" for="30min">30</label>
          <input type="radio" className="btn-check" name="reservation_time" id="45min" value={reservation_time} onChange={change}/>
          <label className="btn btn-outline-dark px-4 me-3" for="45min">45</label>
          <input type="radio" className="btn-check" name="reservation_time" id="60min" value={reservation_time} onChange={change}/>
          <label className="btn btn-outline-dark px-4" for="60min">60</label>
        </div>
        <p>Freie Reservierungsslots</p>
        <p>Anzahl Personen</p>
        <img src={sitzplan} className="w-100" alt="logo" />
      </div>
    </div>
  );
};

export default ReservationPage;
